import react, { useEffect, useState } from 'react'
import{MDBBtn,MDBContainer,MDBModal,MDBModalBody,MDBModalFooter,MDBModalHeader} from 'mdbreact'

function PostHealthUdpates(){

    const[modal,setModal]= useState(false);

    useEffect(()=>{
        window.addEventListener("toggle",toggle)
    })

    function toggle(){
        setModal(!modal);
    }
    return (
      <div>
        <MDBContainer>
          <MDBBtn onClick={toggle} style={{ width: "300px" }}>
            Health Updates +
          </MDBBtn>
          <MDBModal color="stylish-color-dark" isOpen={modal} toggle={toggle} style={{backgroundColor:"black"}}>
            <MDBModalHeader toggle={toggle}>MDBModal title</MDBModalHeader>
            <MDBModalBody>
              <form>
                <label>Weight(kg):</label>
                <input type="text"></input>
                <br />
              </form>
            </MDBModalBody>
            <MDBModalFooter>
              <MDBBtn color="danger" onClick={toggle}>
                Close
              </MDBBtn>
              <MDBBtn color="success">Save changes</MDBBtn>
            </MDBModalFooter>
          </MDBModal>
        </MDBContainer>
      </div>
    );
}

export default PostHealthUdpates;
